/*Table structure for table `fly_assessment` */

DROP TABLE IF EXISTS `fly_assessment`;

CREATE TABLE `fly_assessment` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `schoolid` smallint(5) unsigned NOT NULL DEFAULT '0',
  `addtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `status` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '状态',
  `teacherid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '教师id',
  `semester` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '评价学期',
  `MONTH` int(2) DEFAULT NULL COMMENT '月份',
  `teach_class` varchar(100) NOT NULL DEFAULT '' COMMENT '班级',
  `morality` text NOT NULL COMMENT '师德师风',
  `management` text NOT NULL COMMENT '常规管理',
  `teaching` text NOT NULL COMMENT '教育教学',
  `conservation` text NOT NULL COMMENT '保育工作',
  `research` text NOT NULL COMMENT '教科研究',
  `attendance` text NOT NULL COMMENT '考勤情况',
  `total` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '总分',
  `content` varchar(255) NOT NULL DEFAULT '' COMMENT '考核结果',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8;

