/*Table structure for table `fly_assessment_list` */

DROP TABLE IF EXISTS `fly_assessment_list`;

CREATE TABLE `fly_assessment_list` (
  `id` int(16) NOT NULL AUTO_INCREMENT,
  `grade` varchar(16) DEFAULT NULL,
  `classname` varchar(16) DEFAULT NULL,
  `term` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8;

