/*Table structure for table `fly_attachment` */

DROP TABLE IF EXISTS `fly_attachment`;

CREATE TABLE `fly_attachment` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `ref_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '外键id',
  `tablename` varchar(20) NOT NULL DEFAULT '' COMMENT '属于哪一张表',
  `schoolid` smallint(5) unsigned NOT NULL DEFAULT '0',
  `token` varchar(32) NOT NULL COMMENT 'token',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `filename` varchar(100) DEFAULT NULL,
  `size` decimal(18,0) DEFAULT NULL,
  `type` varchar(20) DEFAULT NULL,
  `savaname` varchar(255) NOT NULL COMMENT '保存路径',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '审核',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `fly_attachment` */

/*Table structure for table `fly_attendance` */

DROP TABLE IF EXISTS `fly_attendance`;

CREATE TABLE `fly_attendance` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `teacherid` int(11) NOT NULL DEFAULT '0' COMMENT '教师id',
  `status_name` varchar(20) DEFAULT NULL COMMENT '状态名称',
  `YEAR` int(4) DEFAULT NULL COMMENT '年份',
  `MONTH` int(2) DEFAULT NULL COMMENT '月份',
  `state` varchar(20) DEFAULT NULL COMMENT '状态名称',
  `states` varchar(20) DEFAULT NULL COMMENT '状态1',
  `sort` smallint(6) DEFAULT '0',
  `remark` varchar(100) DEFAULT NULL COMMENT '备注',
  `iswork` tinyint(4) DEFAULT '1' COMMENT '是否工作日',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `fly_attendance` */

/*Table structure for table `fly_attendance_analysis` */

DROP TABLE IF EXISTS `fly_attendance_analysis`;

CREATE TABLE `fly_attendance_analysis` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `teacherid` int(11) NOT NULL DEFAULT '0' COMMENT '教师id',
  `schoolid` smallint(5) unsigned NOT NULL DEFAULT '0',
  `status_name` varchar(20) DEFAULT NULL COMMENT '状态名称',
  `set_title` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '名称',
  `pubdate` date DEFAULT NULL COMMENT '日期',
  `state` tinyint(1) unsigned DEFAULT '1' COMMENT '状态名称',
  `optdt` time DEFAULT '00:00:00' COMMENT '操作时间',
  `remark` varchar(100) DEFAULT NULL COMMENT '备注',
  `iswork` tinyint(1) DEFAULT '1' COMMENT '是否工作日',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `fly_attendance_analysis` */

/*Table structure for table `fly_attendance_record` */

DROP TABLE IF EXISTS `fly_attendance_record`;

CREATE TABLE `fly_attendance_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `schoolid` smallint(5) unsigned NOT NULL DEFAULT '0',
  `teacherid` int(11) DEFAULT '0' COMMENT '教师id',
  `name` varchar(20) DEFAULT NULL COMMENT '姓名',
  `checktime` datetime DEFAULT NULL COMMENT '时间',
  `type` tinyint(1) DEFAULT '0' COMMENT '来源@0|打卡机,1|异常登记,2|手动添加',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=152 DEFAULT CHARSET=utf8;

