/*Table structure for table `fly_attendance_rest` */

DROP TABLE IF EXISTS `fly_attendance_rest`;

CREATE TABLE `fly_attendance_rest` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `schoolid` smallint(5) unsigned NOT NULL DEFAULT '0',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `pubdate` date DEFAULT '0000-00-00' COMMENT '日期',
  `teacherid` int(11) NOT NULL DEFAULT '0' COMMENT '教师id',
  `set_title` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '名称',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `fly_attendance_rest` */

/*Table structure for table `fly_attendance_set` */

DROP TABLE IF EXISTS `fly_attendance_set`;

CREATE TABLE `fly_attendance_set` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `teacherid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '教师id',
  `schoolid` smallint(5) unsigned NOT NULL COMMENT '学校id',
  `addtime` int(10) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `set_title` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '名称',
  `begintime` varchar(20) DEFAULT NULL COMMENT '开始时间',
  `endtime` varchar(20) DEFAULT NULL COMMENT '结束时间',
  `dodate` date NOT NULL COMMENT '针对日期',
  `iswork` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '0休息,1工作',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8;

