/*Table structure for table `fly_docs` */

DROP TABLE IF EXISTS `fly_docs`;

CREATE TABLE `fly_docs` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `train_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '学生id',
  `schoolid` smallint(5) unsigned NOT NULL DEFAULT '0',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `filename` varchar(100) DEFAULT NULL,
  `size` decimal(18,0) DEFAULT NULL,
  `doctype` varchar(20) DEFAULT NULL,
  `src` varchar(255) NOT NULL COMMENT '文件',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

