/*Table structure for table `fly_evaluation` */

DROP TABLE IF EXISTS `fly_evaluation`;

CREATE TABLE `fly_evaluation` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `schoolid` smallint(5) unsigned NOT NULL DEFAULT '0',
  `teacherid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '教师id',
  `studentid` int(10) NOT NULL DEFAULT '0' COMMENT '学生id',
  `addtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态',
  `semester` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '评价学期',
  `morality` smallint(3) unsigned NOT NULL DEFAULT '0' COMMENT '师德修养',
  `visits` smallint(3) unsigned NOT NULL DEFAULT '0' COMMENT '家访情况',
  `chalkface` smallint(3) unsigned NOT NULL DEFAULT '0' COMMENT '课堂教学',
  `correction` smallint(3) unsigned NOT NULL DEFAULT '0' COMMENT '作业批改',
  `habitual` smallint(3) unsigned NOT NULL DEFAULT '0' COMMENT '学生习惯 养成情况',
  `effect` smallint(3) unsigned NOT NULL DEFAULT '0' COMMENT '教学效果',
  `total` smallint(3) unsigned NOT NULL DEFAULT '1' COMMENT '总评',
  `pubdate` date NOT NULL COMMENT '评论时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

