/*Table structure for table `fly_feedback` */

DROP TABLE IF EXISTS `fly_feedback`;

CREATE TABLE `fly_feedback` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '反馈id',
  `schoolid` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '学校id',
  `teacherid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '教师id',
  `parentid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '家长id',
  `handle_id` varchar(20) NOT NULL DEFAULT '' COMMENT '处理人',
  `content` varchar(500) NOT NULL DEFAULT '' COMMENT '`内容`',
  `feedback_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '投诉主题',
  `submit_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '反馈提交方式',
  `feedback_date` date NOT NULL COMMENT '反馈时间',
  `addtime` int(10) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `feedback_active` tinyint(4) NOT NULL DEFAULT '1' COMMENT '反馈是否通过平台审批(1未通过/2通过)',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '反馈状态',
  `advice` varchar(500) NOT NULL DEFAULT '' COMMENT '整改意见',
  `rectify` varchar(500) NOT NULL DEFAULT '' COMMENT '整改内容',
  `score` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '评价分数',
  `verify` varchar(500) NOT NULL DEFAULT '' COMMENT '评价',
  `check` varchar(500) NOT NULL DEFAULT '' COMMENT '审阅',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

