/*Table structure for table `fly_footmark` */

DROP TABLE IF EXISTS `fly_footmark`;

CREATE TABLE `fly_footmark` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `schoolid` smallint(5) unsigned NOT NULL DEFAULT '0',
  `addtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `status` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '状态',
  `studentid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '学生id',
  `semester` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '评价学期',
  `jcsz` varchar(1000) NOT NULL DEFAULT '' COMMENT '基础素质',
  `xkxx` varchar(1000) NOT NULL DEFAULT '' COMMENT '学科学习',
  `sjhd` varchar(1000) NOT NULL DEFAULT '' COMMENT '综合实践活动',
