  `jspy` varchar(1000) NOT NULL DEFAULT '' COMMENT '教师评语',
  `star` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'star',
  `teacherid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '评价人',
  `pubdate` date NOT NULL DEFAULT '0000-00-00' COMMENT '评论时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

/*Data for the table `fly_footmark` */

insert  into `fly_footmark`(`id`,`schoolid`,`addtime`,`status`,`studentid`,`semester`,`jcsz`,`xkxx`,`sjhd`,`cqqk`,`hjjl`,`wxts`,`jspy`,`star`,`teacherid`,`pubdate`) values (1,1,1445485925,1,123,1,'基础素质基础素质','学科学习','综合实践活动','出勤情况','获奖记录','温馨提示','教师评语',0,9,'2015-10-22'),(2,1,1453304286,1,287,3,'尊敬师长，团结友爱，刻苦学习，勤俭节约','理科成绩比较好，文科仍需多多努力，不要偏科太严重','积极参加学校，班级组织的实践活动，慰问敬老院的爷爷奶奶，很有责任心和爱心','无特殊情况，基本按时上课，无缺课','荣获校级三好学生','学习过程中要善于请教身边的同学，老师，这样进步才会更快更大。','只要好好努力学习，潜力非常巨大',0,10,'2016-12-30');

