/*Data for the table `fly_notice` */

insert  into `fly_notice`(`id`,`date`,`content`) values (1,'2016-03-07','1、上午7：30在星光校区举行新学期开学典礼，梁明强书记讲话、颁奖。\r\n2、上午7：45在亭洪校区举行新学期开学典礼，俞建平校长讲话。\r\n3、第一节各班班会，上好“开学第一课”，班会：弘扬社会主义核心价值观。\r\n4、第八节分别召开初三年级例会和高中年级组长、教研组长会议。\r\n负责部门：政教处，年级组，教务处'),(2,'2016-03-08','1、办理学生转学手续；统计上报各种开学数据，八校联考质量分析；课堂教学监控。\r\n2、检查各功能室；做好初三第一次模拟考的各项准备工作；收集、检查老师教案；起草教务处工作计划；发放本学期整学期快乐学习卡。\r\n3、制定本学期工作计划。\r\n负责部门：教务处，科研处'),(3,'2016-03-09','1、正常文件交换、签收、分发;撰写办公室2016年春季学期工作计划；收集各处室工作计划；收集整理特色普通高中验收评估材料；补打公需科目证书发放；办理社保业务。\r\n2、准备年度考核材料上报；上报财政供养人员信息；办理一位组织考核调入教师的手续；办理一位老师的转正；办理一位教师的退休。\r\n3、第七节召开亭洪校区全体班主任会议。\r\n4、第八节召开全体党员会议。\r\n负责部门：校办室，政教处，书记室');

/*Table structure for table `fly_parents` */

DROP TABLE IF EXISTS `fly_parents`;

CREATE TABLE `fly_parents` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(50) NOT NULL DEFAULT '' COMMENT '用户名',
  `schoolid` smallint(5) unsigned NOT NULL COMMENT '学校id',
  `classid` int(10) NOT NULL COMMENT '班级id',
  `addtime` int(10) NOT NULL DEFAULT '0' COMMENT '注册时间',
  `edittime` int(10) NOT NULL DEFAULT '0' COMMENT '编辑时间',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态 1正常 0锁定',
  `status2` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态码 0没有更新 1资料变更 2密码变更',
  `studentid` int(10) unsigned NOT NULL COMMENT '学生id',
  `relatives` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '亲属类型',
  `fit` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '配合度',
  `experience` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '经验程度',
  `share` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '分享数',
  `transport` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '代步工具',
  `environment` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '家庭环境',
  `activities` smallint(5) unsigned NOT NULL COMMENT '参与活动次数',
  `place` varchar(50) NOT NULL COMMENT '籍贯',
  `tel` varchar(50) NOT NULL DEFAULT '' COMMENT '电话',
  `address` varchar(50) NOT NULL DEFAULT '' COMMENT '地址',
  `birthday` date NOT NULL DEFAULT '0000-00-00' COMMENT '生日',
  `gender` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '性别',
  `email` varchar(50) NOT NULL DEFAULT '' COMMENT '邮箱',
  `degrees` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '学历',
  `sign` varchar(200) NOT NULL DEFAULT '' COMMENT '个性签名',
  `thumb` varchar(100) NOT NULL DEFAULT '' COMMENT '头像',
  `company` varchar(50) NOT NULL DEFAULT '' COMMENT '工作单位',
  `content` varchar(1000) NOT NULL DEFAULT '' COMMENT '个人备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=84 DEFAULT CHARSET=utf8;

