  `listening` varchar(50) NOT NULL DEFAULT '' COMMENT '听力',
  `caries` varchar(20) NOT NULL DEFAULT '' COMMENT '龋 齿',
  `blindness` varchar(50) NOT NULL DEFAULT '' COMMENT '色盲色弱',
  `vaccination` varchar(20) NOT NULL DEFAULT '' COMMENT '疫苗接种情况',
  `heart` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '有无心脏疾病史',
  `content` text NOT NULL COMMENT '健身与保健建议',
  `pubdate` date DEFAULT '0000-00-00' COMMENT '日期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

