/*Table structure for table `fly_question` */

DROP TABLE IF EXISTS `fly_question`;

CREATE TABLE `fly_question` (
  `id` int(32) NOT NULL AUTO_INCREMENT,
  `subjectid` int(10) DEFAULT NULL COMMENT '科目ID',
  `knowledge_pointid` int(10) DEFAULT NULL COMMENT '知识点ID',
  `question_typeid` int(10) DEFAULT NULL COMMENT '问题类型ID',
  `difficulty_degreeid` int(10) DEFAULT NULL COMMENT '难度系数ID',
  `content` longtext COMMENT '试题内容',
  `answer` longtext COMMENT '试题答案',
  `analysis` longtext COMMENT '试题解析',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;

/*Data for the table `fly_question` */

insert  into `fly_question`(`id`,`subjectid`,`knowledge_pointid`,`question_typeid`,`difficulty_degreeid`,`content`,`answer`,`analysis`) values (1,2,20,19,3,'<p>某中学计划购买A型和B型课桌凳共200套. 经招标，购买一套A型课桌凳比购买一套B型课桌凳少用40元，且购买4套A型和5套B型课桌凳共需1820元.</p><p>&nbsp; &nbsp; （1）求购买一套A型课桌凳和一套B型课桌凳各需多少元？</p><p>&nbsp; &nbsp; （2）学校根据实际情况，要求购买这两种课桌凳总费用不能超过40880元，并且购买A型课桌凳的数量不能超过B型课桌凳数量的，求该校本次购买A型和B型课桌凳共有几种方案？哪种方案的总费用最低？</p><p><br/></p>','<p>（1）设A型每套x元，则B型每套（x + 40）元. &nbsp; …………… 1分</p><p>&nbsp; &nbsp; &nbsp;∴4x + 5（x + 40）=1820. &nbsp;……………………………………… 2分</p><p>&nbsp; &nbsp; &nbsp;∴x = 180，x + 40 = 220.</p><p>&nbsp; &nbsp; &nbsp;即购买一套A型课桌凳和一套B型课桌凳各需180元、220元. &nbsp;……………3分</p><p>（2）设购买A型课桌凳a套，则购买B型课桌凳（200 - a）套.</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>a≤（200 - a），</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>180 a + 220（200- a）≤40880.</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>解得78≤a≤80. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; …………… 5分</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>∵a为整数，∴a = 78，79，80</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>∴共有3种方案. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;………………6分</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>设购买课桌凳总费用为y元，则</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>y = 180a + 220（200 - a）=-40a + 44000. &nbsp;…………… 7分</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>∵-40＜0，y随a的增大而减小，</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>∴当a = 80时，总费用最低，此时200- a =120. &nbsp; &nbsp;…………9分</p><p>&nbsp; <span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>即总费用最低的方案是：</p><p>&nbsp; <span class=\"Apple-tab-span\" style=\"white-space: pre;\">	</span>购买A型80套，购买B型120套. &nbsp; &nbsp; &nbsp; &nbsp;………………10分</p><p><br/></p>',NULL),(2,1,12,7,2,'<p>14.阅读下面一首宋词，回答问题（共5分）</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>渔家傲·秋思 &nbsp; &nbsp;（范仲淹）</p><p>塞下秋来风景异，衡阳雁去无留意。四面边声连角起，千嶂里，长烟落日孤城闭。&nbsp;</p><p>浊酒一杯家万里，燕然未勒归无计。羌管悠悠霜满地，人不寐，将军白发征夫泪。</p><p>（1）《渔家傲》一词的感情基调是______。上片写景，描写______，以一个“_____”字统领全部景物。（3分）</p><p>（2）说说“人不寐，将军白发征夫泪”，传达出人物怎样的心理活动？（2分）</p><p><br/></p>','<p>（1）、报效祖国。</p><p>（2）、山东矿机鸿福路口撒酒疯搜的分配时间的飞机上飞机的减肥了开始大家了快速的减肥。</p>',NULL),(3,1,13,1,1,'<p>7.对王安石《登飞来峰》的赏析有误的一项是（）</p><p>飞来山上千寻塔，闻说鸡鸣见日升。</p><p>不畏浮云遮望眼，自缘身在最高层。</p><p>A．诗人借写登塔远望，抒发了自己踌躇满志、不畏困难的情怀。</p><p>B．塔建在山上更显其高，故云“千寻”，这里极写诗人登临之高。</p><p>C．在本诗中，“浮云”这一意象用来比喻具有积极意义的事物。</p><p>D．这首诗将写景和抒怀紧密结合起来，有力地突出了诗的主题。</p><p><br/></p>','',NULL),(4,1,13,1,2,'<p>28.下列说法不正确的一项是（）</p><p>A．《诗经》以四言为主，普遍采用赋、比、兴的手法，有重章叠句的特点。</p><p>B．《史记》是我国第一部纪传体通史，全书一百三十篇，被誉为“史家之绝唱，无韵之离骚”。</p><p>C．鲁迅的散文集《朝花夕拾》，收录了《阿长于〈山海经〉》《从百草园到三味书屋》《故乡》《藤野先生》等作品。</p><p>D．莎士比亚，文艺复兴时期英国戏剧家、诗人，代表作有《哈姆雷特》《奥赛罗》《威尼斯商人》《罗密欧与朱丽叶》等。</p><p><br/></p>','',NULL),(5,1,14,11,3,'<p>闻王昌龄左迁龙标遥有此寄</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\">	</span>李白</p><p>杨花落尽子规啼，闻道龙标过五溪。</p><p>我寄愁心与明月，随风直到夜郎西。</p><p>20.从哪些诗句可以看出龙标被贬之地的偏远？</p><p>21.请对“我寄愁心与明月”这句诗从修辞和作者情感两个角度进行赏析。</p><p><br/></p>','<p>20.“闻道龙标过五溪”、“随风直到夜郎西”答出一句1分。</p><p>21.拟人。抒发了诗人对友人被贬远行的忧虑、关心之情。</p><p><br/></p>',NULL),(6,1,15,11,4,'<p>少年游 早行&nbsp;</p><p>霁霞散晓月犹明，疏木挂残星。山径人稀，翠萝深处，啼鸟两三声。&nbsp;</p><p>霜华重迫驼裘冷，心共马蹄轻。十里青山，一溪流水，都做许多情。</p><p>(1)词的下阕表现了诗人怎样的心境？请结合具体诗句阐述。</p><p><br/></p>','<p>诗人的心境是轻松愉悦；②有直接表现：尽管霜重天冷，但诗人心情轻松，便觉马行轻快。间接表现：以景写情，心情愉悦，便觉青山流水皆有情，赏心悦目。</p>',NULL),(7,1,16,5,1,'<p>醉翁亭记（欧阳修）&nbsp;</p><p>若夫日出而林霏开，云归而岩穴暝，晦明变化者，山间之朝暮也。野芳发而幽香，佳木秀而繁阴，风霜高洁，水落而石出者，山间之四时也。朝而往，暮而归，四时之景不同，而乐亦无穷也。&nbsp;</p><p>&nbsp; 至于负者歌于途，行者休于树，前者呼，后者应，伛偻提携，往来而不绝者，滁人游也。临溪而渔，溪深而鱼肥，酿泉为酒，泉香而酒洌，山肴野蔌，杂然而前陈者，太守宴也。宴酣之乐，非丝非竹，射者中，弈者胜，觥筹交错，起坐而喧哗者，众宾欢也。苍颜白发，颓然乎其间者，太守醉也。&nbsp;</p><p>&nbsp; 已而夕阳在山，人影散乱，太守归而宾客从也。树林阴翳，鸣声上下，游人去而禽鸟乐也。然而禽鸟知山林之乐，而不知人之乐；人知从太守游而乐，而不知太守之乐其乐也。醉能同其乐，醒能述以文者，太守也。太守谓谁?庐陵欧阳修也。</p><p>20．将下面句子翻译成现代汉语。&nbsp;</p><p>①若夫日出而林霏开。&nbsp;</p><p>②苍颜白发，颓然乎其间者，太守醉也。&nbsp;</p><p>21．本文写景传神动人，很值得品味。请你对文中的画线句作点品读。&nbsp;</p><p>22．人生难免会遇到各种挫折，欧阳修被贬滁州却能乐于山水，醉于人和。请结合生</p><p>活实际谈一谈你从中得到了哪些人生启示</p><p><br/></p>','<p>20、</p><p>① 像那太阳一出来，林中的雾气消散了。&nbsp;</p><p>② 容颜苍老,头发花白，醉醺醺地坐在众人中间的,这是太守喝醉了。&nbsp;</p><p>21、此四句确是传神笔致：芳草萋萋，幽香扑鼻写春光；林木挺拔，枝繁叶茂写夏景；风声萧瑟，霜重铺路写秋色；水瘦石枯，草木凋零写冬景。作者只选取最富特征的“春花”“夏树”“秋霜”“冬水”，便写活了四季，给人以不同的美感，自然就有了“乐亦无穷”的感叹。</p><p><br/></p>',NULL),(8,1,3,1,2,'<p style=\"text-indent:184px\"><span style=\";font-family:宋体;font-size:16px\">最佳饮料——白开水</span></p><p>　　<span style=\";font-family:宋体;font-size:16px\">①</span><span style=\";font-family:宋体;font-size:16px\">随着生活水平的提高，各种各样的饮料走进了人们的生活。喝矿泉水、纯净水已是普遍现象。喝雪碧、可乐成了一种时尚，各种名目繁多的功能饮料更是赢得了青少年的青昧，而饮用白开水的人却越来越少。其实，从科学角度来看，任何其他的饮料都无法取代白开水。</span></p><p>　　<span style=\";font-family:宋体;font-size:16px\">②</span><span style=\";font-family:宋体;font-size:16px\">众所周知，水是维持人体正常生理活动所必需的物质，只有保证机体有足够的水分，体内产生的废物才能及时地通过肾脏排出体外。从医学角度上讲，任何饮料都不如白开水对生理健康有价值。白开水最容易解渴，有调节体温、输送养分及清洁身体内部的功能。而且，白开水具有较强的生物活性。对促进细胞新陈代谢、能量转换、血液循环和维持电解质平衡，都大有益处。白开水不含卡路里，在进入人体后，很容易透过细胞膜，增加血液中血红蛋白含量，增强人体自身免疫功能，提高机体抗病能力。因此，白开水实在是人体最需要的天然“饮料”。</span></p><p>　　<span style=\";font-family:宋体;font-size:16px\">③</span><span style=\";font-family:宋体;font-size:16px\">白开水是由自来水煮沸而来的，其主要成分是水，其中还包含多种矿物质和一些人体需要量极少的微量元素。如钠、钾、钙、镁、锌、铁、铜、铅、氟、碘和硒等。矿物质和微量元素是人体必需的营养素，不能缺乏，但也不能过多。自来水所含的矿物质为矿泉水的1/10,又是纯净水的10倍。矿泉水的矿化度一般为200-300毫升/升，自来水为20-30毫升/升，而纯净水只有2-3毫升/升。有关研究表明，自来水中的矿物质和微量元素的含量对人体来说是最适宜的。</span></p><p>　　<span style=\";font-family:宋体;font-size:16px\">④</span><span style=\";font-family:宋体;font-size:16px\">其他的饮料所含糖分和热量</span><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体;font-size: 16px\">一般</span></span><span style=\";font-family:宋体;font-size:16px\">都偏高，食欲旺盛且过量饮用的人，往往会因糖分和热量摄入过多引起肥胖，食欲不振的人则由于饮料影响正餐，可能导致热量摄入不足而渐趋瘦弱。饮料中的果糖会阻止人体对铜的吸收.引起贫血等病症。饮料中的人工色素、防腐剂在体内蓄积，会干扰多种酶的功能，引起消化不良。再者。饮料中的大量电解质不容易很快从胃肠排空，而是较长时间存在于胃肠内，影响消化吸收，降低食欲。同时还加重了肾脏的负担。另外，通过蒸馏和逆渗透技术加以净化后的纯净水会失去如镁、锌、铁、硒、碘等对人体有益的矿物质，长期饮用纯净水，人体便会缺少某些必要的元素而造成营养失衡，这对处于生长期的青少年来说尤为不利。</span></p><p>　　<span style=\";font-family:宋体;font-size:16px\">⑤</span><span style=\";font-family:宋体;font-size:16px\">那么，如何科学地饮用白开水呢?首先要注意喝水时间。饭前饭后半小时和餐中都不宜大量饮水，以免冲淡唾液、胃液，导致消化不良;最好在两顿饭中间适量饮用。其次要掌握喝水的量。成人每天需500～3000毫升，要一次性将一整杯水喝完，这样有利于身体真正吸收;最好每隔l～2小时喝一杯，不要等到有口渴感觉时才饮水。再者要喝新鲜开水。饮用水储存时间不宜过长，否则其中的亚硝酸盐含量就会上升，可转换为有致癌作用的亚硝胺。将水加热到100</span><span style=\";font-family:宋体;font-size:16px\">℃</span><span style=\";font-family:宋体;font-size:16px\">并持续沸腾3分钟，等降温到30</span><span style=\";font-family:宋体;font-size:16px\">℃</span><span style=\";font-family:宋体;font-size:16px\">以下后最适合安全饮用。而生水、不开的水、重新煮开的水、千滚水(反复煮沸的水)、蒸锅水(蒸馒头等的剩锅水)和老化水(长时间贮存不动的水)等，是绝对不可饮用的。</span></p><p style=\"text-indent:32px\"><span style=\";font-family:宋体;font-size:16px\">6</span><span style=\";font-family:宋体;font-size:16px\">．</span><span style=\";font-family:宋体;font-size:16px\">对本文的解读，不正确的一项是（&nbsp; &nbsp;）</span></p><p><span style=\";font-family:宋体;font-size:16px\">A．本文的说明对象是最佳饮料，说明顺序是逻辑顺序</span></p><p><span style=\";font-family:宋体;font-size:16px\">B．从医学角度讲，喝白开水比喝任何饮料对生理健康有价值。</span></p><p><span style=\";font-family:宋体;font-size:16px\">C．白开水确实是人体最需要的天然“饮料”啊。</span></p><p><span style=\";font-family:宋体;font-size:16px\">D．第④段中“一般”可以用“大多”替换，但不可删掉。</span></p><p style=\"text-indent: 32px;\"><br/></p>','',NULL),(9,1,49,11,5,'<p>（二）阅读下文，完成13—16题。（共12分）&nbsp;</p><p>改变世界的第三个“苹果”&nbsp;</p><p>&nbsp;① 有人说，历史上有三个苹果改变了世界，一个是夏娃的苹果，一个是牛顿的苹果，还有一个就是乔布斯的苹果。&nbsp;</p><p>&nbsp;② 乔布斯的这个“苹果”，在计算机行业中几起几落，如今又杀进了通讯领域。自从 2010 年市值超过微软以后，2011年第一季度 iPhone 的销售额达到了123 亿美元，大大超过了长期领先手机行业的诺基亚（94亿美元），跃身为全球最大的手机厂商。最近又爆出，苹果的现金储备超过 700亿美元，一举超越了诺基亚、 RIM 、 HTC 和摩托罗拉移动这四家竞争对手市值的总和。除三星外，苹果可以用现金收购其他任何一家手机厂商。就一家企业来说，这是非常惊人的，也是史无前例的。&nbsp;</p><p>&nbsp;③ 在传统计算机领域，苹果的台式机和笔记本，至今仍是一些发烧友和专业图形工作者的宠儿，充其量也还是一个“小众产品”，而其在手机市场的表现，就大不相同。&nbsp;</p><p>&nbsp;④ 早在 2007 年，苹果就把自己的名字从“苹果电脑公司”改为“苹果公司”，表明了进军手机领域的信心。虽然苹果手机的总市场份额还不及诺基亚，但它已经稳稳地占据了市场的高端。&nbsp;</p><p>&nbsp;⑤ 当今手机的竞争领域，也在随着时光前行而不停扩展。先是硬件。所有的厂商都希望以最优成本提供最好的硬件，元器件制造商如芯片厂商英特尔、高通等的竞争也非常激烈。这种竞争会使手机硬件性能快速提升，价格快速降低。在这一方面，苹果的优势并不明显。&nbsp;</p><p>&nbsp;⑥ 还有手机的操作系统。当今的对阵形势是，苹果的 iOS系统 VS 三星、摩托罗拉等大多数厂商使用的谷歌 Android 系统。虽然诺基亚加入了微软的 Windows Phone7 阵营，但结果还不明朗。未来，苹果能否领先，还要看 iOS 系统的后续研发能力如何。丰富的应用程序也是赢得手机用户青睐的法宝。现在众多的第三方开发者更愿意为苹果的iOS 和谷歌的Android开发程序，支持其余操作系统的开发者实在是门可罗雀。相比之下，由于 iOS 系统的稳定性和可靠性，更多开发者还是会首选在 iPhone 上进行开发，获得成功后再移植到 Android 的平台，在这里，苹果手机比 Android 手机有着更大优势。设计二字就不用多说了，苹果已经证明，好的设计能让消费者为之疯狂。苹果把手机当做一种时尚消费理念灌输给消费者，形成了一种“崇拜”。这一点目前无人可及。</p><p>13．结合文章和已有的知识储备，谈谈第 ① 段中“三只苹果”分别代表了什么，并说明画线句在文中的作用。</p><p><br/></p>','<p>13.夏娃的苹果代表欲望和生命，牛顿的苹果代表着智慧和知识，乔布斯的苹果代表着科技与创新。画线句子在文章中起到引起下文的作用，也更凸显乔布斯以及苹果公司在人类进程中所做出的贡献。</p>',NULL);

/*Table structure for table `fly_question_type` */

DROP TABLE IF EXISTS `fly_question_type`;

CREATE TABLE `fly_question_type` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `subjectid` int(10) DEFAULT NULL COMMENT '科目ID',
  `question_type` varchar(32) DEFAULT NULL COMMENT '试题类型',
  PRIMARY KEY (`id`)
