/*Table structure for table `fly_record` */

DROP TABLE IF EXISTS `fly_record`;

CREATE TABLE `fly_record` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `schoolid` smallint(5) unsigned NOT NULL DEFAULT '0',
  `addtime` int(11) NOT NULL DEFAULT '0',
  `status` tinyint(4) NOT NULL DEFAULT '1',
  `title` varchar(500) NOT NULL DEFAULT '',
  `thumb` varchar(100) NOT NULL DEFAULT '' COMMENT '图片',
  `studentid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '学生id',
  `classid` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '班级',
  `teacherid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '教师id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

