/*Table structure for table `fly_resource` */

DROP TABLE IF EXISTS `fly_resource`;

CREATE TABLE `fly_resource` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `schoolid` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '学校id',
  `classid` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '班级id',
  `teacherid` int(11) NOT NULL DEFAULT '0' COMMENT '教师id',
  `addtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `sort` tinyint(4) unsigned NOT NULL DEFAULT '100' COMMENT '排序',
  `status` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '状态',
  `title` varchar(100) NOT NULL DEFAULT '' COMMENT '标题',
  `content` text NOT NULL COMMENT '内容',
  `type` int(10) NOT NULL DEFAULT '0' COMMENT '素材类型',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

