/*Table structure for table `fly_school` */

DROP TABLE IF EXISTS `fly_school`;

CREATE TABLE `fly_school` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `addtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `sort` tinyint(4) unsigned NOT NULL DEFAULT '100' COMMENT '排序',
  `status` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '状态',
  `catid` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '分类',
  `title` varchar(100) NOT NULL DEFAULT '' COMMENT '标题',
  `thumb` varchar(100) NOT NULL DEFAULT '' COMMENT '缩略图',
  `content` text NOT NULL COMMENT '内容',
  `classes` varchar(1000) NOT NULL DEFAULT '' COMMENT '班级',
  `rfid_client` char(12) NOT NULL DEFAULT '' COMMENT '考勤终端编号',
  `rfid_total` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '发卡数',
  `student_total` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '学生总数',
  `parents_total` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '家长总数',
  `teacher_total` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '教师总数',
  PRIMARY KEY (`id`),
  KEY `catid` (`catid`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='学校';

/*Data for the table `fly_school` */

insert  into `fly_school`(`id`,`addtime`,`sort`,`status`,`catid`,`title`,`thumb`,`content`,`classes`,`rfid_client`,`rfid_total`,`student_total`,`parents_total`,`teacher_total`) values (1,0,100,1,0,'二十一中','','','','',0,0,0,0);

