/*Table structure for table `fly_student` */

DROP TABLE IF EXISTS `fly_student`;

CREATE TABLE `fly_student` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `addtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `classname` varchar(10) NOT NULL DEFAULT '0' COMMENT '班级',
  `number` varchar(50) NOT NULL DEFAULT '' COMMENT '学籍号',
  `name` varchar(10) NOT NULL DEFAULT '' COMMENT '姓名',
  `gender` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '性别',
  `place` varchar(50) NOT NULL DEFAULT '' COMMENT '籍贯',
  `idcard` varchar(50) DEFAULT '' COMMENT '身份证件号码',
  `bloodtype` varchar(10) DEFAULT NULL COMMENT '血型',
  `birthday` date DEFAULT '0000-00-00' COMMENT '出生日期',
  `nation` varchar(20) NOT NULL DEFAULT '' COMMENT '民族',
  `bir_address` varchar(50) NOT NULL DEFAULT '' COMMENT '出生地',
  `account` varchar(16) DEFAULT NULL COMMENT '户口性质',
  `heath_status` varchar(10) DEFAULT NULL COMMENT '健康状况',
  `political_status` varchar(10) DEFAULT NULL COMMENT '政治面貌',
  `account_address` varchar(50) NOT NULL DEFAULT '' COMMENT '户口所在地',
  `address` varchar(50) NOT NULL DEFAULT '' COMMENT '家庭住址',
  `father` varchar(16) DEFAULT NULL COMMENT '父亲姓名',
  `f_workplace` varchar(32) DEFAULT NULL COMMENT '父亲工作单位',
  `f_tel` varchar(20) DEFAULT NULL COMMENT '父亲电话',
  `mother` varchar(16) DEFAULT NULL COMMENT '母亲姓名',
  `m_workplace` varchar(32) DEFAULT NULL COMMENT '母亲工作单位',
  `m_tel` varchar(20) DEFAULT NULL COMMENT '母亲工作单位',
  `thumb` varchar(100) NOT NULL DEFAULT '' COMMENT '头像URL',
  `tel` varchar(20) DEFAULT NULL COMMENT '住宅电话',
  PRIMARY KEY (`id`)
