/*Table structure for table `fly_student_leave` */

DROP TABLE IF EXISTS `fly_student_leave`;

CREATE TABLE `fly_student_leave` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `schoolid` smallint(5) unsigned NOT NULL DEFAULT '0',
  `addtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `status` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '状态',
  `leave_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '分类',
  `content` varchar(255) NOT NULL DEFAULT '' COMMENT '内容',
  `studentid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '教师',
  `aid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '请假人id',
  `isread` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否已阅 0否 1是',
  `reply` varchar(200) NOT NULL DEFAULT '' COMMENT '班主任回复',
  `daynum` smallint(3) unsigned NOT NULL DEFAULT '0' COMMENT '天数',
  `section` smallint(2) unsigned NOT NULL DEFAULT '0' COMMENT '节数',
  `starttime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '开始时间',
  `endtime` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '销假时间',
  PRIMARY KEY (`id`),
  KEY `catid` (`leave_type`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

/*Data for the table `fly_student_leave` */

