/*Table structure for table `fly_student_reward` */

DROP TABLE IF EXISTS `fly_student_reward`;

CREATE TABLE `fly_student_reward` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '(主键)',
  `rewardid` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '奖励表id',
  `studentid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '学生id',
  `teacherid` int(10) NOT NULL DEFAULT '0' COMMENT '指派教师id',
  `doc` varchar(100) NOT NULL DEFAULT '' COMMENT '书面检讨',
  `schoolid` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '学校id',
  `addtime` int(10) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '奖励是否有效(默认有效Y)',
  `pubdate` date NOT NULL COMMENT '获奖励时间',
  `revoketime` date NOT NULL COMMENT '奖励撤消时间',
  `content` varchar(100) NOT NULL DEFAULT '' COMMENT '备注',
  PRIMARY KEY (`id`),
  KEY `studentid` (`studentid`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

