/*Table structure for table `fly_teacher_base` */

DROP TABLE IF EXISTS `fly_teacher_base`;

CREATE TABLE `fly_teacher_base` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `truename` varchar(50) DEFAULT '' COMMENT '真实名称',
  `grade_group` varchar(16) DEFAULT NULL COMMENT '所在的年级组',
  `course` varchar(100) DEFAULT '' COMMENT '任教科目',
  `teach_class` varchar(100) DEFAULT '' COMMENT '授课班级',
  `manage_class` varchar(100) DEFAULT '' COMMENT '管理班级',
  `middle_leader` tinyint(4) DEFAULT '0' COMMENT '是否为中层领导',
  `grade_supervisor` tinyint(4) unsigned DEFAULT '0' COMMENT '是否为年级组长：1是，0不是',
  `teach_supervisor` tinyint(4) unsigned DEFAULT '0' COMMENT '是否为教研组长：1是，0不是',
  `prepare_supervisor` tinyint(4) unsigned DEFAULT '0' COMMENT '是否为备课组长：1是，0不是',
  `dept` tinyint(4) unsigned DEFAULT '1' COMMENT '部门',
  `schoolid` smallint(5) unsigned DEFAULT NULL COMMENT '学校id',
  `addtime` int(10) DEFAULT '0' COMMENT '注册时间',
  `edittime` int(10) DEFAULT '0' COMMENT '编辑时间',
  `status` tinyint(4) DEFAULT '1' COMMENT '状态 1正常 0锁定',
  `status2` tinyint(4) unsigned DEFAULT '0' COMMENT '状态码 0没有更新 1资料变更 2密码变更',
  `username` varchar(50) DEFAULT '' COMMENT '用户名',
  `password` varchar(100) DEFAULT '' COMMENT '密码',
  `nickname` varchar(50) DEFAULT '' COMMENT '昵称',
  `tel` varchar(50) DEFAULT '' COMMENT '电话',
  `height` varchar(10) DEFAULT '' COMMENT '身高',
  `gender` tinyint(4) unsigned DEFAULT '0' COMMENT '性别',
  `email` varchar(50) DEFAULT '' COMMENT '邮箱',
  `Office` varchar(50) DEFAULT '' COMMENT '办公地点',
  `fax` varchar(50) DEFAULT '' COMMENT '传 真',
  `sign` varchar(200) DEFAULT '' COMMENT '个性签名',
  `lastlogintime` int(11) unsigned DEFAULT '0' COMMENT '最后登录时间',
  `logincount` int(11) unsigned DEFAULT '0' COMMENT '登录次数',
  `thumb` varchar(100) DEFAULT '' COMMENT '头像',
  `joinin` date DEFAULT '0000-00-00' COMMENT '入职日期',
  `expireto` date DEFAULT '0000-00-00' COMMENT '合同到期',
  `idcardtype` tinyint(4) DEFAULT '1' COMMENT '证件类型',
  `idcard` varchar(50) DEFAULT '' COMMENT '证件号',
  `marry` tinyint(4) unsigned DEFAULT '1' COMMENT '婚姻',
  `degrees` tinyint(4) unsigned DEFAULT '1' COMMENT '学历',
  `majorin` varchar(50) DEFAULT '' COMMENT '专业',
  `graduate` varchar(50) DEFAULT '' COMMENT '毕业院校',
  `share` smallint(5) unsigned DEFAULT '0' COMMENT '分享数',
  `task` smallint(5) unsigned DEFAULT '0' COMMENT '作业发布数',
