/*Table structure for table `fly_temporary` */

DROP TABLE IF EXISTS `fly_temporary`;

CREATE TABLE `fly_temporary` (
  `id` int(16) NOT NULL AUTO_INCREMENT,
  `schoolid` int(16) DEFAULT NULL,
  `school_type` varchar(16) DEFAULT NULL,
  `term` varchar(16) DEFAULT NULL,
  `grade` varchar(16) DEFAULT NULL,
  `classname` varchar(16) DEFAULT NULL,
  `course` varchar(16) DEFAULT NULL,
  `teacher` varchar(16) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `fly_temporary` */

/*Table structure for table `fly_test_list` */

DROP TABLE IF EXISTS `fly_test_list`;

CREATE TABLE `fly_test_list` (
  `id` int(32) NOT NULL AUTO_INCREMENT COMMENT '每次考试id',
  `test_name` varchar(32) DEFAULT NULL COMMENT '考试名称',
  `grade` varchar(32) DEFAULT NULL COMMENT '考试年级',
  `date` date DEFAULT NULL COMMENT '考试时间',
  `thumb` varchar(128) DEFAULT NULL COMMENT '成绩上传保存路径',
  `analysis_flag` tinyint(1) DEFAULT '0' COMMENT '分析标志',
  PRIMARY KEY (`id`)
