/*Table structure for table `fly_test_score` */

DROP TABLE IF EXISTS `fly_test_score`;

CREATE TABLE `fly_test_score` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `schoolid` smallint(5) unsigned NOT NULL DEFAULT '0',
  `addtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `status` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '状态',
  `exam_type` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '考试类型',
  `subject` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '考试科目',
  `studentid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '学生id',
  `score` smallint(3) unsigned NOT NULL DEFAULT '0' COMMENT '分数',
  `semester` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '学期',
  `pubdate` date NOT NULL DEFAULT '0000-00-00' COMMENT '考试时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

