/*Table structure for table `fly_timetable` */

DROP TABLE IF EXISTS `fly_timetable`;

CREATE TABLE `fly_timetable` (
  `id` int(128) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `schoolid` smallint(5) unsigned NOT NULL DEFAULT '0',
  `school_type` varchar(16) DEFAULT NULL,
  `term` varchar(16) DEFAULT NULL,
  `grade` varchar(16) DEFAULT NULL,
  `classname` varchar(16) DEFAULT '0' COMMENT '班级',
  `week` tinyint(4) DEFAULT '0' COMMENT '星期',
  `section` tinyint(4) DEFAULT '0' COMMENT '第几节课',
  `title` varchar(100) DEFAULT '' COMMENT '课程名称',
  `teacher_truename` varchar(32) DEFAULT NULL COMMENT '老师名字',
  `uid` int(11) DEFAULT '0' COMMENT '上课老师id',
  `title_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1为预排或者规则设定，0是自动排',
  `tips` varchar(200) DEFAULT '' COMMENT '注意事项',
  `content` varchar(128) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=30996 DEFAULT CHARSET=utf8 COMMENT='课程表';

