/*Table structure for table `fly_train` */

DROP TABLE IF EXISTS `fly_train`;

CREATE TABLE `fly_train` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `schoolid` smallint(5) unsigned NOT NULL DEFAULT '0',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `title` varchar(100) NOT NULL DEFAULT '' COMMENT '标题',
  `begintime` date DEFAULT '0000-00-00' COMMENT '开始时间',
  `endtime` date DEFAULT '0000-00-00' COMMENT '结束时间',
  `place` varchar(50) DEFAULT '' COMMENT '培训地点',
  `organize` varchar(50) DEFAULT '' COMMENT '培训组织者/部门',
  `teacher` varchar(50) DEFAULT '' COMMENT '培训讲师',
  `train_type` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '课程类别',
  `fee` varchar(10) DEFAULT '' COMMENT '培训费用',
  `number` varchar(10) NOT NULL DEFAULT '' COMMENT '人数',
  `faceto` varchar(200) DEFAULT '' COMMENT '受众',
  `during` varchar(50) DEFAULT '' COMMENT '课程时长(天)',
  `dept` varchar(50) DEFAULT '' COMMENT '面向部门',
  `purpose` varchar(1000) DEFAULT '' COMMENT '学习目标',
  `content` varchar(500) DEFAULT '' COMMENT '课程简介',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

/*Data for the table `fly_train` */

